import React from "react"

import { FaLinkedin, FaTwitter, FaFacebook, FaInstagram, FaGithub } from 'react-icons/fa';


export default function Footer(){
    return(
        <nav className="foot--icons">
            <FaTwitter size={15} style={{  backgroundcolor: 'rgb(177, 171, 171);',marginRight: '10px' }} />
            <FaFacebook size={15} style={{ backgroundcolor: 'rgb(177, 171, 171);',marginRight: '10px' }} />
            <FaInstagram size={15} style={{backgroundcolor: 'rgb(177, 171, 171);', marginRight: '10px' }} />
            <FaLinkedin size={15} style={{ backgroundcolor: 'rgb(177, 171, 171);',marginRight: '10px' }} />
            <FaGithub size={15} style={{   backgroundcolor: 'rgb(177, 171, 171);', marginRight: '10px' }} />
        </nav>
    )
}
